import React from 'react';
import { connect } from 'react-redux';
import axios from 'axios';
//import PropTypes from "prop-types";

const Table = () => {
	const InvoiceTable = () => {
		axios.get('/api/invoice', res => {
			console.log('HAVE IT');
			res.map((item, key) => {
				return <div key={key}>{item.order_id}</div>;
			});
		});
	};

	return (
		<div>
			<p>Table</p>
			{InvoiceTable()}
		</div>
	);
};
Table.prototype = {};

// const mapStateToProps = state => ({
//   auth: state.auth
// });

export default connect()(Table);
